    m = n_m[1:]

    def remove_row(m):
        # find the index of the first row that contains only white squares
        for i, row in enumerate(m):
            if all(x == '.' for x in row):
                return i, row
        raise ValueError('no white rows')

    def remove_column(m):
        # find the index of the first column that contains only white squares
        for j, col in enumerate(zip(*m)):
            if all(x == '.' for x in col):
                return j, col
        raise ValueError('no white columns')

    def compress(m):
        # remove empty rows and columns, remove white rows and columns
        i, row = remove_row(m)
        j, col = remove_column(zip(*m))
        if not row and not col:
            return
        if not row:
            return compress(m[:i]) + compress(m[i + 1:])
        if not col:
            return compress(zip(*m[:j]) + zip(*m[j + 1:]))
        return [['.'] * w + row + ['.'] * (w - len(row)) for row in m[i:i + h]] + [['.'] * w + col + ['.'] * (w - len(col)) for col in zip(*m[j:j + h])]

    return '\n'.join(''.join(row) for row in compress(m))

