    N, M, K = readings[0:3]
    A = readings[3:3 + N]
    B = readings[3 + N:3 + N + M]

    def possible(a: int, b: int) -> bool:
        return a - b > 0

    def enough(a: int, b: int) -> bool:
        return a >= b

    def can_read(time: int, a: int, b: int) -> bool:
        return time >= a + b

    def read_from(time: int, desk: int, a: int, b: int) -> int:
        return 1 if time < a else 0

    def total_time(time: int, a: int, b: int) -> int:
        return a + b - time

    def read_books(time: int, a: int, b: int) -> int:
        return 1 if time < a else 0

    def read_books_backwards(time: int, a: int, b: int) -> int:
        return 1 if time < a else 0

    def read_time(desk: int, a: int, b: int) -> int:
        return a + b

    def time_to_read(desk: int, a: int, b: int) -> int:
        return a + b

    # Let us see if we can read all books at all
    if can_read(K, A[0], B[0]):
        desk = 0
        time_to_read = total_time(K, A[0], B[0])
        while can_read(time_to_read, A[desk], B[desk]):
            time_to_read += read_time(desk, A[desk], B[desk])
            desk += 1
        return desk
    # If we do not have enough time, we will have to read as much as we can
    # (which will be equal to max(A, B))
    if can_read(K, max(A), max(B)):
        return max(A) + max(B)
    # If we do not have enough time, we will have to read as much as we can
    # (which will be equal to max(A, B))
    if can_read(K, max(A), B[0]):
        return max(A) + B[0]
    # If we do not have enough time, we will have to read as much as we can
    # (which will be equal to max(A, B))
    if can_read(K, A[0], max(B)):
        return A[0] + max(B)
    # We cannot read any books
    return 0


